import React from 'react'
import { Ratio } from 'react-bootstrap'

function VideoPlayer({video} : any) {
  return (
    
          <Ratio aspectRatio='16x9'>
               <video src={video}></video>

          </Ratio>
    
  )
}

export default VideoPlayer
